CREATE TABLE LECTURER
(
    id         INTEGER PRIMARY KEY AUTO_INCREMENT,
    card_uid   TEXT,
    card_id    INTEGER,
    first_name TEXT,
    last_name  TEXT,
    patronymic TEXT,
    phone      TEXT,
    email      TEXT,
    image      BLOB
);
CREATE TABLE SCHEDULE_VERSION
(
    id         INTEGER PRIMARY KEY AUTO_INCREMENT,
    start_date TEXT,
    end_date   TEXT
);
CREATE TABLE SCHEDULE
(
    id         INTEGER PRIMARY KEY AUTO_INCREMENT,
    begin      TEXT,
    end        TEXT,
    number     INTEGER,
    version_id INTEGER,
    FOREIGN KEY (version_id) REFERENCES SCHEDULE_VERSION (id)
);
